            "text" : "here's the pasted version - CALL FOR PAPERS\n \n PHILOSOPHY THEMATIC ISSUE (2019): JOURNAL OF EVALUATION IN CLINICAL PRACTICE\n \n Special Issue on Shared Decision Making\n \n The role of philosophy in discussions of clinical practice was once  regarded by many as restricted to a very limited version of â€˜medical  ethicsâ€™. But in recent years there has been a resurgence of interest in  the philosophy of medicine and healthcare as an intellectually serious  and practically significant enterprise. Controversies about evidence,  value, clinical knowledge, judgment, integrity and ethics have required  practitioners and policymakers to confront the epistemic and moral basis  of practice, while philosophers have found in these debates ways to  invigorate and reframe the investigation of long-standing philosophical  problems, about the nature of reasoning, science, knowledge and  practice, and the relationships between epistemology and ethics, morals  and politics.\n \n The Journal of Evaluation in Clinical Practice is an international  health sciences journal (Impact Factor 1.52) that focuses on the  evaluation and development of clinical practice in medicine, nursing and  the allied health professions. It has a large and diverse readership  including practitioners and academics from a vast range of areas, and  over a twenty-year tradition of publishing papers raising  epistemological, metaphysical and ethical issues underlying clinical  policy and practice. April 2010 saw the publication of the first  thematic issue of the Journal devoted entirely to philosophical issues,  and these â€˜philosophy thematicsâ€™ have now become an established annual  feature of the JECP.\n \n Within the 2019 â€˜philosophy thematicâ€™ we are including a Special Section  on â€˜Shared Decision Makingâ€™, which as UK NICE guidelines note involves  health professionals and patients work together with the goal of putting  people at the centre of decisions about their own treatment and care.  What shifts are necessary in our current thinking and practice to make  shared decision-making a reality? What barriers are there to  establishing shared decision-making as the norm in health practice and  policy? How do we measure success â€“ or the lack of it â€“ in these  contexts? What are the other philosophical and empirical research  questions which warrant urgent consideration?\n \n Submissions for consideration of publication on the relationship between  shared decision making and recent work in evidence-based medicine,  values-based practice and person-centred healthcare, are now cordially  invited from clinicians, philosophers or other academics to be included  within the Special Section. Additionally, we also welcome papers for the  2019 philosophy thematic issue that do not fit the particular theme of  Shared Decision Making, but which represent excellent examples of the  application of philosophy to questions of substantive import in medicine  and healthcare.\n \n Original papers are usually no more than 5000 words in length (though an  extension of word count may be requested), and detailed author  guidelines are available at: https://t.co/Z2WvuGMd57\n \n Manuscripts can be submitted online using the link https://t.co/aozkDjMCMR  - please mark the submissions clearly with the words â€œPhilosophy  Thematic Issue 2019 â€“ Shared Decision Making Special Sectionâ€ OR  â€œPhilosophy Thematic Issue 2019 â€“ Generalâ€. The deadline for submission  of all manuscripts is 1st March 2019. Peer review will be expedited, and  accepted papers published rapidly thereafter. For any questions about  possible submissions please e-mail Professor Michael Loughlin:  michael_loughlin@ymail.com",
