            "text" : "Michael, we reached out to a few Deaf Scholars of Color to see if they can/want to be involved from the ground up on the project. The key component is to give everyone the time they need to get involved. How much time remains to be seen. Urgency, after all, is a trait of white supremacy. So we will wait for the time being. In the meantime, if you want to publish something straight away, please go ahead. There's certainly plenty of potential applications for theory in Deaf Studies.",
