            "text" : "So instead if it just covering the annual first aid kit and checkups that you'd get anyway it became a thing for people who can afford it to stash away a little money instead of paying taxes on it and then using it to pay on a lot of things that are kinda related. So people who really could benefit from it can't afford to use it because getting sick is expensive AF compared to when it was first implemented",
